import './App.css';
import { UserContext } from './store/scc';
import { useContext } from 'react';

function App() {
	const user = useContext(UserContext);

	return (
		<div className="App">
			<span>{user.data}</span>
			{console.log(user.data)}
			<button onClick={user.update}>update</button>
		</div>
	);
}

export default App;
